(13608, 'B2E9BBE2-2BF5-4978-8F28-1F81D1C066AB', '“I want to be very clear with my Republican colleagues. You may win this vote. And Amy Coney Barrett may become the next Associate Justice of the Supreme Court. But you will never, never get your credibility back. And the next time the American people give Democrats a majority in this chamber, you will have forfeited the right to tell us how to run that majority.  You may win this vote. But in the process you will speed the precipitous decline of faith in our institutions, our politics, the Senate and the Supreme Court. You will give an already divided and angry nation a fresh outrage, and open a wound in this chamber that may never heal.  You walk a perilous road.  I know you think that this will eventually blow over. But you are wrong. The American people will never forget this blatant act of bad faith. They will never forget your complete disregard for their voices, for the people standing in line right now voting their choice, not your choice.  They will never forget the lack of consistency, honor, decency, fairness and principle. They will never forget the rights that are limited, constrained or taken away by a far-right majority on the Supreme Court. And history will record that by brute political force, in total contradiction to its stated principles, this Republican majority confirmed a lifetime appointment on the eve of an election; a justice who will alter the lives and freedoms of the American people while they stood in line to vote.'' -Chuck Schumer', 'Nitzan', 'David', '2020-10-28T05:53:45.625661'),
